import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const SellAnItem = (props) => {
  const navigate = useNavigate();
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [price, setPrice] = useState("");

  const handleTitleChange = (event) => {
    setTitle(event.target.value);
  };

  const handleDescriptionChange = (event) => {
    setDescription(event.target.value);
  };

  const handlePriceChange = (event) => {
    setPrice(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission
  };

  return (
    <>
      <h1>Sell An Item</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="title">Item Address</label>
          <input
            type="text"
            id="title"
            name="title"
            value={title}
            onChange={handleTitleChange}
          />
        </div>
        <div>
          <label htmlFor="description">Item Price</label>
          <textarea
            id="description"
            name="description"
            value={description}
            onChange={handleDescriptionChange}
          />
        </div>
        <div>
          <label htmlFor="price">Transaction Fee</label>
          <input
            type="text"
            id="price"
            name="price"
            value={price}
            onChange={handlePriceChange}
          />
        </div>
        <button className="submit" onClick={() => navigate("/blog")}>
           Submit
        </button>
      </form>
      <br />
      <button onClick={() => navigate(-1)}>Back to Home</button>
    </>
  );
};

export default SellAnItem;
